import React from 'react'

const Middle = (props) => {
	return (
		<div
			style = {{height: '79.61vh', position: 'fixed', top: '12.39vh', width: '100%'}}
		>

			<div 
				className = 'tab0'
				style = {{height: '100%'}}
			>
				<div style = {{height: '96%', borderRadius: '20px', width: '90%', margin: '0 auto ', background: 'linear-gradient(143deg, #ff5656 6%, #cd3d3d 93%)',
					boxShadow: '3px 3px 10px 0 rgba(0, 0, 0, 0.2), -3px -3px 10px 0 rgba(255, 255, 255, 0.8)'}}>

				</div>
			</div>

		<h6>tab: {props.showTab}</h6>
		</div>
	)
}

export default Middle
